CpuSqlDispatcher::CpuDispatchFunction CpuSqlDispatcher::nullFunction = &CpuSqlDispatcher::NullCol;

int32_t CpuSqlDispatcher::NullCol()
{
    auto colName = arguments_.Read<std::string>();
    auto reg = arguments_.Read<std::string>();

    int8_t* maskMin = AllocateRegister<int8_t>(reg + "_min", 1, true);
    int8_t* maskMax = AllocateRegister<int8_t>(reg + "_max", 1, true);

    maskMin[0] = 1;
    maskMax[0] = 1;

    return 0;
}